webpackJsonp([0x9a2791553874],{"./node_modules/json-loader/index.js!./.cache/json/property-values-analysis.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h1 id="2019-property-values-in-diamond-bar-ca"><a href="#2019-property-values-in-diamond-bar-ca" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>2019 Property values in Diamond Bar, CA</h1>\n<h2 id="overview"><a href="#overview" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Overview</h2>\n<p>In 2019, as provided by the <a href="https://data.lacounty.gov/Parcel-/Assessor-Parcels-Data-2019/csig-gtr7">Los Angeles county data portal</a>, there were 46,756 accessor parcel records for the zip code 91765.\nWithin the zip code 91765 the main city located there is Diamond Bar, CA. As I continued my analysis my main question was what is the average price of homes and how affordable are they.</p>\n<h2 id="location"><a href="#location" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Location</h2>\n<div style="width:50%;float:right;padding:0px 5px">\n<p><img src="https://raw.githubusercontent.com/axefx/axefx.github.io/source/content/sample-posts/03%E2%80%9306-2020-Property-Values-Analysis/diamond-bar-location.png" alt="location-diamond-bar"></p>\n</div>\n<p>According to Wikipedia, "Diamond Bar is a city in eastern Los Angeles County, California, United States.[9] As of the 2010 census it had a population of 55,544,[10] and in 2018 the population was estimated to be 56,275." <a href=\'https://en.wikipedia.org/wiki/Diamond_Bar,_California\'>[1]</a></p>\n<h2 id="average-prices"><a href="#average-prices" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Average Prices</h2>\n<p>In the accessor records, I found out of the different types of use cases that 97% were specifically used for Single Family Residences.\nWhen used as a family residence, I found that the building types were 25% were condos and 72% Single Family Residence type.</p>\n<div style="width:60%;padding:5px5px;margin:auto;">\n<p><img src="https://raw.githubusercontent.com/axefx/axefx.github.io/source/content/sample-posts/03%E2%80%9306-2020-Property-Values-Analysis/average-totalvalues.png" alt="average-totalvalues"></p>\n</div>\n<p>After narrowing down the data, I found that Single Family Residence buildings had an average total value of about $579,819.\nOn the other side condos had an average total value of about 343,247.</p>\n<h2 id="affordability"><a href="#affordability" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Affordability</h2>\n<p><img src="https://raw.githubusercontent.com/axefx/axefx.github.io/source/content/sample-posts/03%E2%80%9306-2020-Property-Values-Analysis/affordability.png" alt="affordability"></p>\n<p>After calculating some monthly payments of household incomes and using the recommended 30% of your yearly income for your house payments, I analysed those results against the data.\nIn the city of Diamond Bar, 42% of Single Family Residences were considered affordable with a minimum income of 50,000 a year and a down payment of 20%.\n26% of the of those residences fall under the range between 50,000 and 75,000 of yearly income.</p>',timeToRead:1,excerpt:"2019 Property values in Diamond Bar, CA Overview In 2019, as provided by the  Los Angeles county data portal , there were 46,756 accessor…",frontmatter:{title:"Property Values Analysis",cover:"https://raw.githubusercontent.com/axefx/axefx.github.io/source/content/sample-posts/03–06-2020-Property-Values-Analysis/average-totalvalues.png",date:"03/06/20",category:"Data_Science",tags:["Data_Science"]},fields:{nextTitle:"current react-md Themes",nextSlug:"/current-react-md-themes",prevTitle:"Live: Working with Sass Project in Gatsby",prevSlug:"/live-working-with-sass-project-in-gatsby",slug:"/property-values-analysis"}}},pathContext:{slug:"/property-values-analysis"}}}});
